	uML_ActivityEdge_isConsistentWith_RedefinableElement = factory->createOperation_in_Class(uML_ActivityEdge);
	uML_ActivityEdge_isConsistentWith_result = factory->createParameter_in_Operation(uML_ActivityEdge_isConsistentWith_RedefinableElement);uML_ActivityEdge_isConsistentWith_RedefinableElement_UML_ActivityEdge_isConsistentWith_redefiningElement = factory->createParameter_in_Operation(uML_ActivityEdge_isConsistentWith_RedefinableElement);


    //-------------------------------------------
	// ActivityFinalNode
	uML_ActivityFinalNode = factory->createClass_in_Package(uML);
	

    //-------------------------------------------
	// ActivityGroup
	uML_ActivityGroup = factory->createClass_in_Package(uML);
	
