	uML_ActivityNode_isConsistentWith_result = factory->createParameter_in_Operation(uML_ActivityNode_isConsistentWith_RedefinableElement);uML_ActivityNode_isConsistentWith_RedefinableElement_UML_ActivityNode_isConsistentWith_redefiningElement = factory->createParameter_in_Operation(uML_ActivityNode_isConsistentWith_RedefinableElement);


    //-------------------------------------------
	// ActivityParameterNode
	uML_ActivityParameterNode = factory->createClass_in_Package(uML);
	
